import User from "./User";
let users = [
  { id: 1, name: "rafi", age: 20 },
  { id: 2, name: "shirzai", age: 25 },
  { id: 3, name: "sabawoon", age: 22 },
];
function person() {
  return (
    <div className="row">
      <User {...users[0]} />
      <User name="shirzai" />
      <User name="sabawoon" />
    </div>
  );
}
export default person;
